import React, { memo } from 'react';
import { Routes, Route } from 'react-router-dom';
import Header from './common/Header';



const App = memo(() => {
    return (
        <div>
            <Header/>

            <Routes>
                <Route path='' exact element={<Main />} />
            </Routes>
        </div>
    );
});

export default App;
